import { useState } from "react";
import SearchResultsItem from "./SearchResultsItem";
import Chip from '@mui/material/Chip';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import DeviceThermostatIcon from '@mui/icons-material/DeviceThermostat';
import EditLocationIcon from '@mui/icons-material/EditLocation';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Alert from '@mui/material/Alert';

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

export default function SearchResults({ results, isSearching, lnoticias, mensajerror }) {     
    //console.log(lnoticias.articles);
    console.log(results.main);
    return(        
        <div style={{ 
            width: "100%",
            justifyContent: "center",
            display: "block",
            flexDirection: "column",
            width: "100%",
            alignItems: "center",
        }}>
            <Grid container spacing={2} columns={1}>
        <Grid item xs={12}>
        {results.length < 1  ? <Alert severity="error" disabled={!isSearching}>{mensajerror}</Alert>
                :                              
                <Box sx={{ width: '100%', bgcolor: 'background.paper' }}>
                    <Box sx={{ my: 3, mx: 12 }}>
                    <Grid container alignItems="center">
                        <Grid item xs>
                        <Typography gutterBottom variant="h4" component="div">
                            {results.name}
                        </Typography>
                        </Grid>
                        <Grid item>
                        <Typography gutterBottom variant="h6" component="div">
                        {results.sys && results.sys.country} <EditLocationIcon />
                        </Typography>
                        </Grid>
                    </Grid>                    
                    </Box>
                    <Divider variant="middle" />
                    <Box sx={{ m: 2 }}>
                    <Typography gutterBottom variant="body1">
                        Datos de humedad
                    </Typography>
                    <Stack direction="row" spacing={1}>
                        <Chip label={results.main && "Humedad: "+results.main.humidity} />
                        <Chip color="primary" label={results.main && "Presíon: "+results.main.pressure} />
                        <Chip label={results.main && "Temperatura: "+results.main.temp} />
                    </Stack>
                    </Box>
                    <Box sx={{ mt: 3, ml: 1, mb: 1 }}>                                         
                    </Box>
                </Box>
                }
        </Grid>        
      </Grid>     
      <Box sx={{ flexGrow: 1 }}>   
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md:1 }}>                
                    {lnoticias.articles &&
                        <SearchResultsItem inoticias={lnoticias.articles && lnoticias.articles} msjerror={mensajerror}/> 
                    }                
            </Grid>
        </Box>                  
        </div>        
    );
}
